export const SchemaTypes = {
  string: "string",
  number: "number",
  boolean: "boolean",
};

const validateData = (schema, data) => {
  Object.keys(data).forE((key) => {
    const type = schema[key];
    let value = data[key];

    try {
      value = JSON.parse(value);
    } catch (error) {
      value = value;
    }

    if (typeof value !== type) {
        return {}
    }
  });
};
